import React from 'react';

const Home: React.FC = () => {
    return (
        <div className="content-box">
            <h2>Welcome to My Personal Site!</h2>
            <p>Checkout some of my most recent projects, or learn more about me!</p>
        </div>
    );
};

export default Home;
